import React from 'react'
import './login.css'

export default function Login() {
    return (
        <>
            <form>
                <fieldset style={{ border: '2px black solid', padding: '10px' }}>
                    <h2
                        style={{
                            textAlign: 'center',
                            fontSize: '40px',
                            color: 'black',
                        }}
                    >
                        <b>
                            <u>Login</u>
                        </b>
                    </h2>
                    <p>
                        <label>Username:</label>
                        <input type='text' id='uname' autoComplete='off' placeholder='Please enter your name' />
                    </p>
                    <p>
                        <label>Password:</label>
                        <input
                            type='password'
                            className='psd'
                            autoComplete='off'
                            placeholder='Please enter password'
                            onkeyup='passCheck(this.value)'
                        />
                    </p>
                    <div className='showpsd'>
                        <button
                            style={{ width: '200px' }}
                            type='button'
                            onClick={(x) => {
                                var password = document.getElementsByClassName('psd')
                                var y = password.getAttribute('type')
                                if (y === 'password') {
                                    password.setAttribute('type', 'text')
                                    x.innerText = 'Hide Password'
                                } else {
                                    password.setAttribute('type', 'password')
                                    x.innerText = 'Show Password'
                                }
                            }}
                        >
                            Show Password
                        </button>
                    </div>
                </fieldset>
            </form>
        </>
    )
}
